def match(r,c, r2, c2):
    if r > 3 or c > 3 or r < 0 or c < 0 or r2 > 3 or c2 > 3 or r2 < 0 or c2 < 0:
        return False
    return m[r][c] == "x" and m[r2][c2] == "x"

