    if(match(r,c+1,r,c-1) or\
       match(r,c+1,r,c+2) or\
       match(r,c-1,r,c-2) or\
       match(r+1,c,r-1,c) or\
       match(r+1,c,r+2,c) or\
       match(r-1,c,r-2,c) or\
       match(r+1,c+1,r-1,c-1) or\
       match(r+1,c+1,r+2,c+2) or\
